import React from 'react';
import './ChatSider.css';

function ChatSider(){
  return(
    <div>
      <div className="chat-sider-container">
        <div className="chat-sider-head">
          <span></span>
        </div>
        <div className="chat-sider-body">
        </div>
      </div>
    </div>
  )
}

export default ChatSider;
